import React from 'react'

function Search() {
  return (
    <div className='search'>
      <div className="searchbox">
        <label htmlFor=""></label>
        <input type="text" className='searchBar' id='search'/>
        <input type="text" className='dateBar' />
      </div>
    </div>
  )
}

export default Search
